commits.content:
.wrapper {
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 80px;
    margin-bottom: 100px;
}
.aboutSection { width: 1210px; }
.title {
    font-family: 'foundry-boldita';
    font-size: 43px;
    color: #2B1A51;
}
.definition {
    margin: 57px 0px;
    font-family: 'gilroy-regular';
    font-size: 21px;
    line-height: 31.5px;
    color: #2B1A51;
}
.textSection1 {
    display: flex;
    margin-bottom: 100px;
}
.textSection1 span { 
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    margin-left: 71px;
}
.topic {
    font-family: 'gilroy-regular';
    font-size: 17px;
    line-height: 25.5px;
    color: #2B1A51;
}
.textSection2 { display: flex; }
.textSection2 .topic {
    margin-top: 47px;
    margin-right: 26px;
}
.missionSection, .valuesSection, .productsSection {
    margin-top: 100px;
    width: 1210px;
}
.mission {
    background-color: #fff;
    box-sizing: border-box;
    padding: 66px 103px
}
.mission .title, .valuesSection .title, .productsSection .title, .benefitsSection { font-size: 33px; }
.mission .topic {
    margin-top: 40px;
    display: flex;
}
.mission .topicColumn { width: 50%; }
.valuesList {
    margin-top: 40px;
    display: grid;
    grid-template-columns: repeat(3, 386px);
    grid-template-rows: repeat (3, 366px );
    column-gap: 26px;
}
.value {
    height: 100%;
    background-color: #fff;
    box-sizing: border-box;
    padding: 47px 46px;
}
.valueTitle {
    font-family: 'gilroy';
    font-size: 19px;
    line-height: 28.5px;
    color: #2B1A51;
    margin-bottom: 20px;
}
.valueTopic {
    font-family: 'gilroy-regular';
    font-weight: 400;
    font-size: 13px;
    line-height: 19.5px;
    color: #2B1A51;
}
.principlesSection, .benefitsSection, .partnersSection {
    margin-top: 100px;
    width: 1210px;
    display: flex;
    justify-content: space-between;
}
.principlesSection .leftPart {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    margin-right: 180px;
}
.benefitsSection .leftPart { margin-right: 100px;}
.leftPart .ps {
    font-family: 'gilroy-regular';
    font-size: 17px;
    line-height: 25.5px;
    color: #2B1A51;
    margin-top: 32px;
}
.leftPart .title { font-size: 33px; }
.product {
    margin-top: 40px;
    box-sizing: border-box;
    padding: 51px 104px;
    background-color: #fff;
}
.header {
    display: flex;
    align-items: center;
    margin-bottom: 26px;
}
.header p {
    margin-left: 46px;
    font-family: 'gilroy';
    font-size: 19px;
    color: #2B1A51;
}
.productDescription {
    font-family: 'gilroy-regular';
    font-size: 17px;
    line-height: 25.5px;
    color: #2B1A51;
}
.productDescription p { margin-bottom: 30px; }
.productDescription p:last-child { margin-bottom: 0; }
.partnersSection .leftPart { 
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    margin-right: 71px;
}
.partnersText { margin-top: 40px; }
.partnersText p{
    font-family: 'gilroy-regular';
    font-size: 17px;
    line-height: 25.5px;
    margin-bottom: 30px;
    color: #2B1A51;
}
.slogan {
    display: flex;
    justify-content: space-between;
}
.slogan p {
    font-family: 'gilroy';
    font-size: 21px;
    color: #2B1A51;
}
.partnersSection img {
    height: 800px;
}
